const ProductList = () => {
  const dispatch = useDispatch();
  useEffect(()=>{
      dispatch(fetchProducts);
  }, [])

  return(
    <div className="c-section-wrapin">
      <div className="p-grid__row"></div>
    </div>
  )
}

export default ProductList
